import React from "react";

import "./productsHome.css";

const ProductsHome = props => {


    return(
        <div id="productContainer">
            <a href="/product">
            <img className="productImage" src="https://loremflickr.com/360/360" alt="random" />
            </a>
            <img className="productImage" src="https://loremflickr.com/360/360" alt="random" />
        </div>
    );
};

export default ProductsHome;
